import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import * as serviceWorker from "./serviceWorker";
import { Provider } from "react-redux";
import store from "./store/store";
import * as firebase from "firebase";

const firebaseConfig = {
  apiKey: "AIzaSyAm1DLVEQkxP0wEafEreWgoM9jqjlJtDU0",
  authDomain: "userdetails-a5b5d.firebaseapp.com",
  databaseURL: "https://userdetails-a5b5d.firebaseio.com",
  projectId: "userdetails-a5b5d",
  storageBucket: "userdetails-a5b5d.appspot.com",
  messagingSenderId: "758477676994",
  appId: "1:758477676994:web:9bf5aad11d6bf29a86b65b"
};

firebase.initializeApp(firebaseConfig);
ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,
  document.getElementById("root")
);

serviceWorker.unregister();
